import styled from "styled-components";

interface Props {
  marginRight: string;
  src: string;
}

const AvartarImg = styled.img`
  width: 30px;
  height: 30px;
  border-radius: 50%;
  margin-right: -5px;
  object-fit: cover;
`;

export default function Avartar(props: Props) {
  return <AvartarImg src={props.src} />;
}
